import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import logo from './logo.svg';
import '@govbr-ds/core/dist/core.min.css';



function App() {
    return (
        <div>
            <Header />
            <div className="col-sm-5 col-lg-3 mb-3">
                <div className="br-input small input-button">
                    <label for="input-login-small">Logar</label>
                    <input id="input-login-small" type="text" placeholder="Digite seu usuário" />
                    <button className="br-button" type="button" aria-label="Botão de ação"><i className="fas fa-arrow-right" aria-hidden="true"></i>
                    </button>
                </div>
            </div>

            <Footer />
        </div>
    );
}

export default App;
